import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the search input
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_input.png'));

    // Click on the search button
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    await page.click('.search-btn');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_button_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_button_clicked.png'));

    // Wait for search suggestions to appear
    await page.waitForSelector('.search-suggestions', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_suggestions_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_suggestions_visible.png'));

    // Click on the first suggestion
    await page.waitForSelector('.suggestion-item', { timeout: 5000 });
    await page.click('.suggestion-item');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_first_suggestion_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_first_suggestion_clicked.png'));

    // Verify the search results
    await page.waitForSelector('.search-results', { timeout: 5000 });
    const resultsCount = await page.evaluate(() => {
      return document.querySelector('.results-count').textContent;
    });

    return {
      success: true,
      action: "Performed search autocomplete test and verified results",
      extractedData: { resultsCount },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
